import React from 'react';
import '../App.css';

function JoinUs() {
  return (
    <div className="container" style={{ padding: '20px' }}>
      <h1>Join Us</h1>
      <div className="section">
        <h2>Recruitment Positions</h2>
        <ul>
          <li>Directors of HR & Administration</li>
          <li>Cost Supervisor</li>
          <li>Hiring Manager</li>
          <li>Training Manager</li>
          <li>Deputy General Manager of Production</li>
        </ul>
      </div>
      <div className="section">
        <h2>Application Method</h2>
        <p>Tel: 0961004504 (陈氏 水朝)</p>
      </div>
    </div>
  );
}

export default JoinUs;
